import React from "react";

const Contact = () => {
  return (
    <>
     <div className="myy-5">
        <h1 className="text-center">Contact Us</h1>
     </div>
     <div className="container contact_div">
        <div className="row">
            <div className="col"></div>
        </div>
     </div>
    </>
  );
};

export default Contact;
